module.exports = JSON.parse('{"001":{"name":"ЗАГАЛЬНА ІНФОРМАЦІЯ","content":{"001":{"question":"Для чого призначений портал?","answer":"Платформа uaSOS.org об’єднує біженців, які шукають житло, з приватними особами, установами, громадськими організаціями та компаніями, які пропонують житло. На відміну від інших ініціатив, які збирають подібні дані, платформа uaSOS.org автоматично пов’язує оголошення тих, хто потребує допомоги, з пропозиціями допомоги, щоб надати якомога ширшу допомогу якомога ширшому колу людей. Завдяки платформі людям, які потребують допомоги, не доведеться переглядати сотні доступних пропозицій допомоги, а отримають найбільш підходящу та найактуальнішу, з урахуванням їхніх потреб. Реєстрація на платформі не є анонімною, що забезпечує безпеку для обох сторін."},"002":{"question":"Хто створив цей портал?","answer":"Ініціативу підтримують польські та українські громадські організації, органи місцевого самоврядування та багато компаній, які не тільки забезпечують найкращі технології, а й дають можливість охопити сотні тисяч людей по обидва боки кордону. Платформа створена за участю десятків волонтерів і заснована на вдосконаленому двигуні, який в майбутньому дає можливість розробки платформи для задоволення інших потреб (наприклад, транспорту)."},"003":{"question":"Чи безпечно це?","answer":"Платформа була повністю захищена з юридичної сторони (включаючи питання RODO) експертами, які співпрацюють з юридичною фірмою ID Advisory. Він також має ряд технічних гарантій, таких як: персональні дані обробляються в хмарі Google, набір оброблених даних обмежений, а реєстрація відбувається через Facebook і Gmail, що забезпечує підвищену безпеку. \\n\\nПри цьому ми не можемо перевірити всіх осіб, які заповнюють анкети через портал. Тому, будь ласка, зв\'яжіться з вашим господарем / господинею і уточніть всі деталі перед перебуванням."},"004":{"question":"Як створити обліковий запис?","answer":"Щоб створити обліковий запис, вам потрібно буде заповнити свою адресу електронної пошти та номер телефону, на який буде відправлено код підтвердження."},"005":{"question":"Чи потрібно вводити свої особисті дані?","answer":"Щоб правильно зареєструватися, потрібно вказати свою адресу електронної пошти та номер телефону. Ми просимо ваше ім\'я для полегшення спілкування між сторонами."},"006":{"question":"Що таке політика конфіденційності та GDPR?","answer":"Щоб ознайомитися з політикою конфіденційності, перейдіть на вкладку \\"Політика конфіденційності\\"."},"007":{"question":"Чи можу я редагувати своє оголошення?","answer":"Щоб відредагувати своє оголошення, після входу натисніть на меню поруч з оголошенням (\\"три крапки\\") і виберіть функцію \\"Редагувати\\"."},"008":{"question":"Як видалити оголошення?","answer":"Видалити оголошення можна двома способами: \\n\\nпісля входу натисніть на меню поруч з повідомленням (\\"три крапки\\") і виберіть функцію \\"Видалити\\" або \\n\\nв електронному листі \\"UA SOS - Ми знайшли для вас потенційного гостя\\" у вас є можливість вибрати варіант видалення лістингу."},"009":{"question":"Чи стягується плата за створення облікового запису?","answer":"Портал безкоштовний, він покликаний допомогти людям, які рятуються від війни в Україні. На будь-якому етапі реєстрації або використання нашого порталу не стягується плата."},"010":{"question":"Як працює алгоритм сполучення додатків? ","answer":"Алгоритм шукає обидві бази даних, щоб знайти якомога більше потенційних зв\'язків між хостами та потенційними гостями на основі їхніх вимог. Кожні 15 хвилин алгоритм запускається для пошуку з\'єднань для нових зареєстрованих користувачів, а також для людей, які ще не знайшли пропозицію або відхилили попередню пропозицію."},"011":{"question":"Чи буду я проінформований про стан? ","answer":"Так, ми будемо тримати вас в курсі стану вашої програми по електронній пошті - регулярно перевіряйте свою поштову скриньку. \\n\\nКрім того, коли ми знайдемо потенційного гостя / господаря для вас, ми повідомимо вас за допомогою SMS."}}},"002":{"name":"ДЛЯ ПОМІЧНИКІВ/ХОСТІВ ","content":{"001":{"question":"Я хочу допомогти, як я можу прийняти?","answer":"Щоб зробити місце доступним, зареєструйтеся на порталі, вкажіть свою адресу електронної пошти, номер телефону та активуйте свій обліковий запис.\\n\\nЯк тільки ми знайдемо для Вас потенційного гостя - ми повідомимо вас про це по електронній пошті і СМС. Потім ви зможете зайти на портал, побачити ключову інформацію з відповідної гостьової форми та прийняти або відхилити пропозицію.\\n\\nЯк тільки обидві сторони підтвердять зв\'язок, ви обміняєтеся контактними даними - уточните останні дані і підтвердите, де зустрінетеся. Пам\'ятайте, що не всі будуть говорити польською, тому електронна пошта іноді може бути більш зручним варіантом, так як в інтернеті є багато перекладачів, за допомогою яких можна перекласти свою кореспонденцію."},"002":{"question":"Я хочу допомогти біженцям. Чи потрібна допомога тільки українцям?","answer":"Коли почалася війна, в Україні були люди різних національностей – наприклад, вони навчалися, у відрядженнях, на контрактах тощо. Ми допомагаємо всім людям, незалежно від їх національності, громадянства, політичних поглядів, релігії, сексуальної орієнтації або приналежності до етнічної меншини."},"003":{"question":"Чи можу я вказати, скільки людей я хочу прийняти і чи є сім\'я з дітьми кращою, наприклад?","answer":"Звичайно. Кожен, хто вирішить допомогти людям, які приїжджають з України, може заявити, скільки людей вони хочуть допомогти, приймаючи їх. Також можна вказати, чи готові ви прийняти, наприклад, сім\'ю з дітьми, тваринами і т.д."},"004":{"question":"Чи потрібно їхати на кордон, щоб прийняти біженця?","answer":"На даний момент портал в першу чергу призначений для того, щоб допомогти вам знайти житло для біженців. Якщо ви в змозі забрати людину з кордону або з певного місця, це вітається, але не потрібно. Ви можете надати таку додаткову інформацію у формі. У майбутньому будуть додані додаткові функціональні можливості, які допоможуть у пошуку транспорту, робочих місць тощо."},"005":{"question":"Я не розмовляю українською, як я можу спілкуватися?","answer":"Краща форма спілкування - по електронній пошті. Вам не потрібно знати українську мову, щоб спілкуватися з людиною, яка її розмовляє. В Інтернеті є багато перекладачів, за допомогою яких ви можете перекласти свою кореспонденцію."},"006":{"question":"Чи потрібно вказувати свою домашню адресу?","answer":"Ви повинні вказати свою домашню адресу, щоб створити обліковий запис на порталі. Він не буде показаний гостю – гість побачить тільки місто проживання. Ми пропонуємо господареві та гостю зустрітися в публічному просторі."},"007":{"question":"За який мінімальний період часу я можу прийняти людину з України?","answer":"Мінімальний час для прийому людини з України - одна ніч."},"008":{"question":"Чи перевіряє сервіс користувачів порталу?","answer":"Користувачі входять за допомогою свого профілю за допомогою електронної пошти, Facebook або Gmail, і їх номери телефонів перевіряються"},"009":{"question":"Чи можу я відмовитися від прийому біженця?","answer":"Ми усвідомлюємо той факт, що життя відбувається в різних випадкових ситуаціях, тому ви можете відмовитися від прийому біженців в будь-який час. Однак, будь ласка, пам\'ятайте, що ваша пропозиція прийняти людей з України важлива для них, і вони, можливо, не зможуть знайти нове місце для ночівлі. Волонтерство вирішуєте допомогти."},"010":{"question":"Чи потрібно допомагати біженцям фінансово?","answer":"Вам не потрібно надавати фінансову допомогу біженцям. Це тільки ваша добра воля."},"011":{"question":"Чи потрібно забезпечувати житлом біженців?","answer":"З огляду на ситуацію з біженцями, надання їжі, принаймні на початковий період їх перебування, вітається, але залишається добровільним."},"012":{"question":"Я не користуюся Інтернетом, як я можу приймати біженців з України?","answer":"Для того, щоб допомогти біженцям з України через наш портал, потрібно зареєструватися на ньому. Однак, якщо ви не користуєтеся Інтернетом щодня, ви можете запитати людей, які це роблять."},"013":{"question":"Чи можу я стягувати плату з біженців за комунальні послуги?","answer":"Люди, які приїхали з України, втекли від війни. Спробуйте підтримати їх у цей важкий час. Якщо ви вирішили допомогти біженцям, також врахуйте, що ваші комунальні платежі можуть зрости."}}},"003":{"name":"ДЛЯ БІЖЕНЦІВ / ВІДВІДУВАЧІВ","content":{"001":{"question":"Я біженець з України, як знайти житло?","answer":"Щоб знайти житло, зареєструйтеся на порталі, вкажіть свою адресу електронної пошти, номер телефону та активуйте свій обліковий запис і перерахуйте свої потреби у формі. \\n\\nЯк тільки ми знайдемо потенційного хоста для вас, ми повідомимо вас по електронній пошті та SMS. Після цього ви зможете зайти на портал, переглянути профіль хоста і прийняти або відхилити їх пропозицію. \\n\\nЯк тільки обидві сторони підтвердять зв\'язок, ви обміняєтеся контактними даними - уточните останні дані і підтвердите, де зустрінетеся. Пам\'ятайте, що не всі будуть говорити українською мовою - тому контакт по електронній пошті іноді може бути більш зручним варіантом, так як в Інтернеті є багато перекладачів, за допомогою яких ви можете перекласти свою розмову."},"002":{"question":"Чи можу я розраховувати на транспортування від кордону до кінцевого пункту призначення?","answer":"Не кожен, хто пропонує житло біженцям, є автомобільним або може запропонувати транспорт. Отримана вами пропозиція може бути позначена як \\"з транспортом\\". В іншому випадку ви можете попросити свого господаря про допомогу в приватному листуванні."},"003":{"question":"Чи повинен я платити за кімнату і дошку для людини, яка прийняла мене?","answer":"Допомога біженцям є самовідданою і безкоштовною. Люди, які реєструються на порталі і пропонують допомогу, нічого не чекають натомість. Однак пам\'ятайте, що служба не несе відповідальності за умови, за яких вас приймуть. Переконайтеся, що ви не очікуєте нічого натомість."}}}}');

